    "headlineNews": "Josh Allen completed 35-of-47 passes for 353 yards, three touchdowns, and one interception in the Bills' 34-31, Week 6 loss to the Titans Monday night.\n",
    "report": "",
    "analysis": "He carried the ball a team-high nine times for 26 yards, but it was one yard too few, as Allen's last-minute 4th-and-1 keeper inside-the-five came up inches short as his feet slipped out from underneath him on the slick grass. The Bills were ultra-aggressive, passing up the short field goal to tie the game at 34-34 and instead tried to go for the win. We like the call, as the Bills were moving the ball at will; it just didn't work. Allen was great on the night as a whole, tossing 14- and 29-yard touchdowns to Stefon Diggs and Cole Beasley in the first half before hitting TE Tommy Sweeney for a one-yarder in the third frame. Allen then caught a two-pointer from TE Dawson Knox on the next play. Allen has been incredible after a down Weeks 1 and 2. He has 14 touchdowns over his last four games and heads into the bye before a Week 8 home date with the lowly Dolphins.\n",
