    "headlineNews": "Justin Herbert completed 23-of-39 passes for 195 yards, one touchdown and an interception in the Chargers' 34-6, Week 6 loss to the Ravens.\u00a0\n",
    "report": "",
    "analysis": "Herbert crashed back down to earth after last Sunday's scintillating affair, posing a season low for yardage even as the Chargers spent the entire afternoon playing from behind. The story of the day was the Chargers' reversal of fortune on fourth down, where they went 1-for-4. They turned it over on downs from their own 39 and 19-yard line, with the latter failure coming in the third quarter and essentially ending the game. They were already losing 24-6, so it was a sensible gamble. It just didn't work. Herbert has had some accuracy issues creep in of late, but nothing of a systematic variety. Just tough games in a tough league. Mike Williams' knee issue surely did not help this afternoon. Still looking like an MVP contender on the whole, Herbert gets the Chargers' bye before a tough Week 8 date with a Patriots defense that eradicated the Bolts in a 45-0 2020 victory. That game, of course, was with Anthony Lynn instead of Brandon Staley on the sideline.\u00a0\n",
