    "analysis": "Burrow found wide open receivers throughout the game and evaded pressure time and again to extend plays and give his play-making receivers a chance to get downfield. His downfield chemistry with Ja'Marr Chase only gets better with every passing week, as Ravens defenders discovered on Sunday. Burrow overcame a hostile Baltimore crowd and operated the team's offense without a hiccup while using a silent count (until Ravens fans were quieted to a hush in the fourth quarter). After bringing along Burrow slowly in the season's first month, head coach Zac Taylor appears to have removed the restricter plate for Burrow and the Bengals offense. Burrow will be a top fantasy play next week against the Jets.\u00a0\n",
