    "analysis": "Winston boosted his stat line with eight rushes for 40 yards with his legs, setting season-highs as a runner with Taysom Hill out with a concussion. He also wasn't helped by his wideouts in the pass game, as Tre'Quan Smith was on a completely different page most of the night while Kevin White and Kenny Stills dropped deep balls. Winston's touchdown pass was a 13-yarder to Alvin Kamara, who caught 10 balls for 128 yards and the score. Winston isn't a fantasy option in this low-volume offense but gets a potential ceiling spot next week against the Bucs.\n",
