    "report": "",
    "analysis": "Jones tacked on 28 yards as a runner. The Panthers were unable to mount a functional offense and didn't push New York to keep the gas pedal down. It was an uneventful day for the young passer until the Giants dialed up a trick play that saw Dante Pettis throwing a back-shoulder pass to Jones, who reeled in the toss with one hand. Jones has just one game with over 300 passing yards or multiple touchdowns through the air but does get a juicy matchup with the Chiefs next week. Normally a high-end QB2, Jones will jump into the back-half of the QB1 ranks versus Kansas City.\u00a0\n",
