    "headlineNews": "Geno Smith completed just 12-of-22 passes for 167 yards and one touchdown in the Seahawks' 13-10, Week 7 loss to the Saints Monday night.\n",
    "report": "",
    "analysis": "He somehow didn't turn the ball over, though Smith tried to throw a pick-six on the final 4th-and-28 play of the game after taking back-to-back sacks. He nearly took a safety before getting rid of it. Smith was sacked five times in this one and was flat-out pitiful, looking scared in the pocket and missing open receivers all night. His first pass of the evening was an 84-yard touchdown to DK Metcalf where Metcalf manhandled Marshon Lattimore for the ball. Smith did nothing positive. This offense is unwatchable with him under center. We're going to get another dose of Smith next week against the Jaguars before Russell Wilson (finger) is hopefully back following the Week 9 bye.\n",
