    "headlineNews": "Matt Ryan completed 25-of-40 passes for 336 yards, two touchdowns and an interception in the Falcons' 30-28, Week 7 win over the Dolphins.\u00a0\n",
    "report": "",
    "analysis": "Leaning on Kyle Pitts for chunk gains \u2014 five of the rookie's seven grabs went for 20-plus yards \u2014 Ryan nearly equalled his pre-bye performance in London for his best outing of the season. His scores went for five yards to Calvin Ridley and 49 to Russell Gage, who ran right by Jevon Holland. Ryan did lose a fumble on an ill-fated fourth quarter scramble, though his \"interception\" was actually a catch that Ridley simply let get ripped away. Ridley has remained an issue for Ryan, as he can't get his alpha wideout going. Hopefully that changes in Week 8 against the collapsing Panthers.\u00a0\u00a0\n",
