    "headlineNews": "Jared Goff completed 22-of-36 passes for 268 yards, one touchdown and two interceptions in the Lions' 28-19, Week 7 loss to the Rams.\u00a0\n",
    "report": "",
    "analysis": "On a day where the Lions emptied out their bag of tricks \u2014 they converted two fake punts and recovered a first quarter onside kick \u2014 Goff reminded the Rams why they traded him, throwing what proved to be a game-sealing end zone interception with 4:53 remaining. It killed a marathon Lions drive, one that would have culminated with a Lions lead had they found the end zone. Goff was hit as he threw and let Jalen Ramsey run T.J. Hockenson's route for him. Goff added another pick for good measure with the Lions out of timeouts and trailing 28-19 with 0:32 remaining. Ultimately, it was a decent day for a quarterback without weapons, though D'Andre Swift did all of the work on the duo's 63-yard screen score in the opening frame. The Lions know Goff is not their future, but they lack better options for the present. Seeing as they are 0-7, it doesn't hold water that they would need to bench Goff to tank for better draft position. The Eagles are on deck for Week 8.\u00a0\u00a0\n",
