    "headlineNews": "Justin Fields has excelled with play-action passes this season, posting a 99 passer rating compared to a 49.7 passer rating on straight drop backs.\u00a0\n",
    "report": "",
    "analysis": "The problem, of course, is that Matt Nagy and the Bears have used play action on one in four Fields attempts this year. Add it to the list of grievances against Nagy. Fields has completed 65.6 percent of his passes when using play action, 11 percent higher than his non-play action throws. His yards per attempt jumps from 5.8 without play action to 7.6 with play action. The Bears' offense was as stale as ever in their Week 7 demolition against Tampa, doing nothing in the way of misdirection or creative play calling. Nagy seems content letting Fields drop back like a traditional pocket passer. Hopefully Chicago's next coach will recognize Fields' potential as a dual threat QB.\u00a0\n",
