    "analysis": "The expected quarters and quarters of garbage time never developed as the Lions kept the game surprisingly tight, but Swift made sure that didn't matter by housing a screen for a 63-yard touchdown on the Lions' opening drive. After that, it was a day of what might have been, as Swift got stood up on some critical short-yardage carries in the third quarter before Jared Goff missed him on what probably should have been TD No. 2. Goff's second interception was a too-high pass that hit off Swift's hands. It was still impossible to complain as Swift provided his hoped-for big play and PPR stat padding. The pathetic Eagles are on deck for Week 8, keeping Swift locked in as an RB1.\u00a0\n",
