    "headlineNews": "NewOrleans.com's Nick Underhill said the Saints' signing of Mark Ingram will allow the team to \"move [Alvin] Kamara around the field, and get him some looks as an outside wide receiver and from the slot.\"\u00a0\n",
    "report": "",
    "analysis": "The Saints have used Kamara as more of a traditional, between-the-tackles runner this season while the team's personnel limitations have stopped coaches from deploying Kamara in a more \"dynamic\" role, Underhill said. Kamara, who handled 20 rushing attempts Monday night against Seattle, already has 61 percent of the carries he had in 2020 and should blow by his career high in rushes this year. Saints coaches wanted to use Kamara more as a pass catcher lining up in the slot and out wide, but \"those plans got blown up when Tony Jones Jr. suffered an injury against the Giants,\" Underhill said, adding that a \"higher percentage of [Kamara's] touches are coming on runs up the middle where he\u2019s getting hit by bigger and stronger players than he would be on a reception or run outside the numbers.\" Ingram absorbing some of those hits on up-the-middle runs should mitigate wear and tear on Kamara and could lead to a more prominent pass-catching role. His PPR prospects don't take a hit with the addition of Ingram. Kamara has a team-high 26 percent target share through Week 7.\u00a0\n",
