    "headlineNews": "Panthers head coach Matt Rhule said the Panthers needed \"more from the run game\" in the team's lopsided Week 7 loss to the Giants.\u00a0\n",
    "report": "",
    "analysis": "Rhule went into Week 7 determined to establish the run at any cost. The Panthers consequently had seven rushing attempts on their opening drive against a soft Giants defense, and lead back Chuba Hubbard finished with 12 rushes for 28 yards (along with four receptions for 28 yards). He blamed himself and other Carolina coaches for \"not coaching Sam [Darnold] well enough,\" insisting the team's struggles aren't \"about Sam,\" who was benched on Sunday. \"We needed more from the run game. We needed some explosive plays,\" Rhule said. \"We needed some guys to make some big catches.\" Rhule discovered, as most head coaches of bad teams do, that establishing the run is difficult when playing from behind, as the Panthers did in Week 7. Hubbard should continue to see solid usage when Carolina can create neutral or positive game script. That might come as soon as Week 8 against the Falcons.\u00a0\n",
