    "headlineNews": "Javonte Williams rushed four times for 20 yards in the Broncos' Week 7 loss to the Browns, adding six receptions for 32 additional yards and a touchdown.\u00a0\n",
    "report": "",
    "analysis": "As usual, Williams found himself in a 50-50 split with Melvin Gordon, who also found the end zone with an impressive lunge at the end of an eight-yard reception. The veteran out-carried Williams 8-4, though Williams got him 6-2 through the air, turning a screen into a 10-yard touchdown with 5:23 remaining. It was an impressive play, but not moreso than Gordon's score one quarter earlier. Williams is providing some big-play juice, but Gordon has hardly been chopped liver. With the passing game struggling to make noise, the Broncos are almost certainly going to keep both backs heavily involved for the foreseeable future. Williams will remain a low-end RB2/FLEX for Week 8 vs. the Football Team.\u00a0\n",
