    "report": "",
    "analysis": "Ridley has drawn 10-plus targets in each of his past four appearances but has just 230 yards to show for it. One of his missed connections today was a Matt Ryan \"interception\" that was really a catch Ridley let get ripped out of his hands. Another was an over-the-middle look where Ridley essentially got broken in two by the defense. That one was Ryan's fault. Ridley remained down for a few moments before making it to the sideline under his own power and quickly returning. Ridley's quiet day came as Kyle Pitts contributed five receptions of 20-plus yards. Pitts' emergence is going to free up space for Ridley, who can't keep operating at this level of inefficiency. He will be on the WR1/2 borderline for Week 8 against the Panthers.\u00a0\u00a0\n",
