    "headlineNews": "CeeDee Lamb caught 9-of-11 targets for 149 yards and two touchdowns in the Cowboys' Week 6 overtime win over the Patriots.\u00a0\n",
    "report": "",
    "analysis": "Surrendering a surprising amount of targets to Cedrick Wilson, Lamb came alive late, with each of his two touchdowns coming in the final 20 minutes of regulation/overtime. The first was a one-yarder where Lamb got wide open in the end zone. The second was a walk-off, 35-yard score in overtime. Lamb got freed by play-action and blew by Jalen Mills. The entire stadium knew the game was over the second the ball left Dak Prescott's hand. Hurt by an overabundance of run-friendly game scripts, Lamb had been in something of a slump since Week 2. He began to bust it with 4/84/1 in Week 5 before obliterating it today as Prescott attempted 51 passes. The Cowboys now head on bye for Week 7 before returning against a struggling Vikings defense that watched Patrick Peterson get banged up on Sunday. Buckle up.\u00a0\n",
