    "headlineNews": "Amari Cooper caught 5-of-8 targets for 55 yards in the Cowboys' Week 6 overtime win over the Patriots.\u00a0\n",
    "report": "",
    "analysis": "There is no way to sugarcoat what was yet another disappointing day for Cooper, this time on an afternoon where Dak Prescott was actually forced to sling it. Prescott had 51 attempts. The problem for Cooper is that seven of them went to Cedrick Wilson with another 15 divvied up between Ezekiel Elliott and Dalton Schultz as CeeDee Lamb led the offense with nine looks. As FanDuel's\u00a0JJ Zachariason points out, Cooper has not had a top-24 day in PPR since Week 1. Injury has played a part in that, but waiting for a big Cooper fantasy effort has turned into the gritty modern reboot of\u00a0Waiting for Godot.\u00a0Hopefully Cooper can get back to 100 percent health during the Cowboys' Week 7 bye, and he comes out swinging against the Vikings' lax defense in Week 8.\u00a0\n",
