    "headlineNews": "Tee Higgins caught 7-of-15 targets for 62 yards in the Bengals' Week 7 win against the Ravens.\u00a0\n",
    "report": "",
    "analysis": "He now has 28 targets over three games back from a shoulder injury. Higgins led all Bengals pass catchers in targets by a comfortable margin. He missed out on two downfield receptions on plays that appeared to be defensive pass interference. He also saw an end zone target before the game got out of hand. All seven Higgins receptions had something in common: The second-year wideout created zero separation against Baltimore defenders. That, in short, is the difference between Higgins and alpha WR1 Ja'Marr Chase. Higgins should be a serviceable WR3 option next week against the Jets.\u00a0\n",
