    "headlineNews": "Kyle Pitts has lined up out wide on 31.6 percent of his snaps this season, the highest rate among tight ends.\u00a0\n",
    "report": "",
    "analysis": "Pitts' encouraging usage in the Atlanta offense has finally paid off with back-to-back outstanding performances in which the rookie tallied 16 receptions for 282 yards and a touchdown. No tight end is running more routes on the outside of the formation, and only five tight ends have run a greater percentage of slot routes than Pitts through seven weeks. Pitts has lined up as an in-line tight end on a mere 12 percent of his snaps this year. Against the Dolphins in Week 7, Pitts lined up on the outside on a whopping 42.4 percent of his snaps -- the most, by far, among tight ends on the week. He posted an outrageous 18.6 average depth of target in his demolition of the Miami secondary. Patience has paid off for Pitts drafters who ensured a slow September from their tight end. They could have an elite producer if Pitts' usage as a hybrid wideout continues.\u00a0\n",
